import React, { useState }  from 'react';
import { Link } from 'react-router-dom';
import Button from 'react-bootstrap/Button';
//Bootstrap and Col, row and Form libraries
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Row from 'react-bootstrap/Row';

//Bootstrap and jQuery libraries
import 'bootstrap/dist/css/bootstrap.min.css';
import 'jquery/dist/jquery.min.js';
//Datatable Modules
import "datatables.net-dt/js/dataTables.dataTables"
import "datatables.net-dt/css/jquery.dataTables.min.css"
import "datatables.net-buttons/js/dataTables.buttons.js"
import "datatables.net-buttons/js/buttons.colVis.js"
import "datatables.net-buttons/js/buttons.flash.js"
import "datatables.net-buttons/js/buttons.html5.js"
import "datatables.net-buttons/js/buttons.print.js"
import "datatables.net-dt/css/jquery.dataTables.min.css"
import $ from 'jquery'; 
//For API Requests
import axios from 'axios';




const names = [
  {
    "title" : "mr",
    "firstname" : "Lawson",
    "lastname" : "Luke",
    "age" : 28,
    "occupation" : "Software Developer",
    "hobby" : "coding"
  },
  {
    "title" : "mr",
    "firstname" : "Michael",
    "lastname" : "Jackson",
    "age" : 35,
    "occupation" : "Singer",
    "hobby" : "dancing"
  },
  {
    "title" : "mr",
    "firstname" : "Janet",
    "lastname" : "Jackson",
    "age" : 35,
    "occupation" : "Singer",
    "hobby" : "dancing"
  }
]


export default function Reportro() {
  const [validated, setValidated] = useState(false);

  const handleSubmit = (event) => {
    const form = event.currentTarget;
    if (form.checkValidity() === false) {
      event.preventDefault();
      event.stopPropagation();
    }
    setValidated(true);
  }

  return (
    <>
    <div className='m-3'>
    <div className="breadcrumb mt-2">
      <Link to={'/'}>Dashboard</Link>&nbsp; Â» &nbsp;<span>Reports</span>
    </div>
    <center>
      <h3 className='mt-sm-5'> RO Inspection Reports</h3>
    </center>
    <Form noValidate validated={validated} onSubmit={handleSubmit}>
    <div id="progress_report" style={{textAlign: "center", padding: "0.5%", backgroundColor: "#FFE0E1"}}>You are watching data from  to </div>
      <Row className="mb-3 mt-4">
        <Form.Group as={Col} md="4" controlId="validationCustom01">
          <Form.Label>From Date *</Form.Label>
          <Form.Control
            required
            type="date"
            placeholder="First name"
          />
           <Form.Control.Feedback type="invalid">
           Please provide From Date
            </Form.Control.Feedback>
        </Form.Group>
        <Form.Group as={Col} md="4" controlId="validationCustom02">
          <Form.Label>To Date</Form.Label>
          <Form.Control
            required
            type="date"
            placeholder="To Date"
          />
          <Form.Control.Feedback type="invalid">
            Please provide To Date
          </Form.Control.Feedback>
        </Form.Group>
        <Form.Group as={Col} md="4" controlId="validationCustom02">
          <Button className="mt-4" type="submit" id="inspection_report" >View Reports</Button>
        </Form.Group>
      </Row>
    </Form>
    </div>

    </>
  );
}
